import { Container, MovieList, Movie } from "./style";


function Home(){

    const movies = [
        {
            title: 'Boi',
            image_url: 'https://nominuto.com/_assets/files/2016/03/Vaquejada3.jpg'

        },
        {
            title: 'Vaca',
            image_url: 'https://nominuto.com/_assets/files/2016/03/Vaquejada3.jpg'
        },
        {
            title: 'Vaqueiro',
            image_url: 'https://nominuto.com/_assets/files/2016/03/Vaquejada3.jpg'
        },
    ]
    return(
        <Container>
            <h1>Movies</h1>
            <MovieList>
                {movies.map(movie => {
                    return(
                        <Movie>
                            <a href=""><img src={movie.image_url} alt={movie.title}></img></a>
                            <span>{movie.title}</span>
                        </Movie>
                    )
                })}
            </MovieList>
        </Container>
    )

}



export default Home;
